import React from "react";
import ReactDOM from "react-dom";

const TodoList = () => {
  return (
    <ul>
      <li>Learn react</li>
      <li>Build Awesome App</li>
    </ul>
  );
};

const AppHeader = () => {
  return <h1>My Todo List</h1>;
};

const SearchPanel = () => {
  return <input placeholder="search" />;
};
const A = (
  <div>
    <AppHeader />
    <SearchPanel />
    <TodoList />
  </div>
);
ReactDOM.render(el, document.getElementById("root"));
